print(f"Total stabilizers: {len(stabilizers)}")

# Verify all lengths
for i, s in enumerate(stabilizers):
    if len(s) != 175:
        print(f"ERROR: Stabilizer {i} has length {len(s)}")

print("All stabilizers verified as length 175")

# Build the circuit using stim
n = 175

# Use stim's Tableau.from_stabilizers
try:
    tableau = stim.Tableau.from_stabilizers(
        [stim.PauliString(s) for s in stabilizers],
        allow_underconstrained=True,
        allow_redundant=True
    )
    print(f"Tableau created successfully with {len(tableau)} qubits")
    
    # Generate the circuit from the tableau
    circuit = tableau.to_circuit(method="elimination")
    print(f"Circuit created with {len(circuit)} operations")
    
    # Save circuit
    with open(r'data\gpt5.2\agent_files\circuit_175.stim', 'w') as f:
        f.write(str(circuit))
    print("Circuit saved to circuit_175.stim")
    
except Exception as e:
    print(f"Error: {e}")
